import React from "react";

const Contact = () => {
  return (
    <section className="section" id="contact">
      <h2>Contact</h2>
      <div className="pixel-card">
        <p>Email: <b>tyagianshika410@gmail.com</b></p>
        <p>Phone: <b>+91 95555 96099</b></p>
        <p>Location: <b>Delhi</b></p>
        <p>
          LinkedIn: <a className="btn" href="https://www.linkedin.com/in/anshika-tyagi-413b99266/" target="_blank" rel="noreferrer">Open</a>
          &nbsp;&nbsp;
          GitHub: <a className="btn" href="https://github.com/Tech-Anshika" target="_blank" rel="noreferrer">Open</a>
        </p>
      </div>
    </section>
  );
};

export default Contact;
